"vs/workbench/parts/codeEditor/electron-browser/accessibility":["Définition du paramètre 'editor.accessibilitySupport' sur 'activé'.","Ouverture de la page de documentation sur l'accessibilité dans VS Code.","Nous vous remercions de tester les options d'accessibilité de VS Code.","État :","Pour configurer l'éditeur de sorte qu'il soit optimisé en permanence pour une utilisation avec un lecteur d'écran, appuyez sur Commande+E.","Pour configurer l'éditeur de sorte qu'il soit optimisé en permanence pour une utilisation avec un lecteur d'écran, appuyez sur Ctrl+E.","L'éditeur est configuré pour utiliser les API de la plateforme afin de détecter si un lecteur d'écran est attaché, mais le runtime actuel ne prend pas en charge cette configuration.","L'éditeur a automatiquement détecté qu'un lecteur d'écran est attaché.","L'éditeur est configuré pour détecter automatiquement si un lecteur d'écran est attaché, ce qui n'est pas le cas pour le moment.","L'éditeur est configuré de sorte qu'il soit optimisé en permanence pour une utilisation avec un lecteur d'écran. Vous pouvez changer ce comportement en modifiant le paramètre 'editor.accessibilitySupport'.","L'éditeur est configuré de sorte à ne jamais être optimisé pour une utilisation avec un lecteur d'écran.","Appuyez sur Tab dans l'éditeur pour déplacer le focus vers le prochain élément pouvant être désigné comme élément actif. Activez ou désactivez ce comportement en appuyant sur {0}.","Appuyez sur Tab dans l'éditeur pour déplacer le focus vers le prochain élément pouvant être désigné comme élément actif. La commande {0} ne peut pas être déclenchée par une combinaison de touches.","Appuyez sur Tab dans l'éditeur pour insérer le caractère de tabulation. Activez ou désactivez ce comportement en appuyant sur {0}.","Appuyez sur Tab dans l'éditeur pour insérer le caractère de tabulation. La commande {0} ne peut pas être déclenchée par une combinaison de touches.","Appuyez sur Commande+H pour ouvrir une fenêtre de navigateur contenant plus d'informations sur l'accessibilité dans VS Code.","Appuyez sur Ctrl+H pour ouvrir une fenêtre de navigateur contenant plus d'informations sur l'accessibilité dans VS Code.","Vous pouvez masquer cette info-bulle et revenir à l'éditeur en appuyant sur Échap ou Maj+Échap.","Afficher l'aide sur l'accessibilité"],
"vs/workbench/parts/codeEditor/electron-browser/inspectKeybindings":["Développeur : Inspecter les mappages de touches"],
"vs/workbench/parts/codeEditor/electron-browser/languageConfiguration/languageConfigurationExtensionPoint":["Erreurs durant l'analyse de {0} : {1}","Séquence de chaînes ou de caractères de crochets ouvrants.","Séquence de chaînes ou de caractères de crochets fermants.","Définit les symboles de commentaire","Définit le marquage des commentaires de bloc.","Séquence de caractères au début d'un commentaire de bloc.","Séquence de caractères à la fin d'un commentaire de bloc.","Séquence de caractères au début d'un commentaire de ligne.","Définit les symboles de type crochet qui augmentent ou diminuent le retrait.","Définit les paires de crochets. Quand vous entrez un crochet ouvrant, le crochet fermant est inséré automatiquement.","Définit une liste d'étendues où les paires automatiques sont désactivées.","Définit les paires de crochets qui peuvent être utilisées pour entourer la chaîne sélectionnée.","La définition du mot dans le langage","L'expression régulière utilisée pour la recherche","Les options d'expression régulière utilisées pour la recherche","Doit valider l'expression régulière `/^([gimuy]+)$/`.","Paramètres de mise en retrait du langage.","Si une ligne correspond à ce modèle, toutes les lignes qui la suivent doivent être mises en retrait une fois (jusqu'à ce qu'une autre règle corresponde).","Modèle RegExp pour increaseIndentPattern.","Indicateurs RegExp pour increaseIndentPattern.","Doit valider l'expression régulière `/^([gimuy]+)$/`.","Si une ligne correspond à ce modèle, pour toutes les lignes qui la suivent le retrait doit être réduit une fois (jusqu'à ce qu'une autre règle corresponde).","Modèle RegExp pour decreaseIndentPattern.","Indicateurs RegExp pour decreaseIndentPattern.","Doit valider l'expression régulière `/^([gimuy]+)$/`.","Si une ligne correspond à ce modèle, **seule la ligne suivante** doit être mise en retrait une fois.","Modèle RegExp pour indentNextLinePattern.","Indicateurs RegExp pour indentNextLinePattern.","Doit valider l'expression régulière `/^([gimuy]+)$/`.","Si une ligne correspond à ce modèle, sa mise en retrait ne doit pas être changée et la ligne ne doit pas être évaluée par rapport aux autres règles.","Modèle RegExp pour unIndentedLinePattern.","Indicateurs RegExp pour unIndentedLinePattern.","Doit valider l'expression régulière `/^([gimuy]+)$/`.","Paramètres de repliage de la langue.","Un langage adhère à la règle du hors-champ si les blocs dans ce langage sont exprimées par leur indentation. Si spécifié, les lignes vides appartiennent au bloc suivant.","Les marqueurs de langage spécifiques de repliage tels que '#region' et '#endregion'. Les regex de début et la fin seront testés sur le contenu de toutes les lignes et doivent être conçues de manière efficace.","Le modèle de RegExp pour le marqueur de début. L’expression régulière doit commencer par '^'.","Le modèle de RegExp pour le marqueur de fin. L’expression régulière doit commencer par '^'."],
